import { useState } from "react";

function Button({count, handleClick}) {
  return(
    <button onClick={handleClick}>
      Clicked {count} times
    </button>
  );
}

function App() {
  const [count, setCount] = useState(0);
  function handleClick() {
    setCount(count + 1);
  }

  return (
    <div>
      <Button count = {count} handleClick={handleClick} />
      <Button count = {count} handleClick={handleClick}/>
    </div>
  );
}
export default App;
